import React from 'react'

import ReactSearchBox from 'react-search-box'


export default class Search extends React.Component {
    constructor() {
        super()

    }

    data = [
        {
            key: 'emad',
            value: 'bey',
        },
        {
            key: 'jane',
            value: 'Jane Doe',
        },
        {
            key: 'mary',
            value: 'Mary Phillips',
        },
        {
            key: 'robert',
            value: 'Robert',
        },
        {
            key: 'karius',
            value: 'Karius',
        },
    
        {
            key: 'Emad',
            value: 'Bay',
        },
    
    ]



    render() {
        return (
            <div>
                <ReactSearchBox
                    placeholder="Placeholder"
                    value="Doe"
                    data={this.data}
                    callback={record => console.log(record)}
                />


            </div>
        );
    }
};
